    [],nt"num_tags": 0,nt"name": "crescent-city-california-tsunami-forecast-grids-for-most-model",nt"isopen":
    false,nt"url": null,nt"notes": "The Crescent City, California Forecast
    Model Grids provides bathymetric data strictly for tsunami inundation modeling with
    the Method of Splitting Tsunami (MOST) model. MOST is a suite of numerical simulation
    codes capable of simulating three processes of tsunami evolution: generation, transoceanic
    propagation, and inundation of dry land. Tsunami waves are computationally propagated
    across a set of three nested grids (A, B, and C), each of which is successively
    finer in resolution, moving from offshore to onshore. Nearshore details are resolved
    to the point that model output can be directly compared with tide gauge observations
    and can provide estimates of wave arrival time, wave amplitude and simulation of
    wave inundation onto dry land. A Grid Resolution: 72 arc-sec. B Grid Resolution:
    12 arc-sec. C Grid Resolution: 2 arc-sec.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
